import React from "react";
import styled from "styled-components";
import { getFundThemeList } from "../service";
// css文件以module.css结尾,用一个变量接收
// import fundstyle from "./fund.module.css";
import { Icon } from "@iconify/react";
import { CapsuleTabs } from "antd-mobile";

const arr = {
  近1周: "SYL_Z",
  近1月: "SYL_Y",
  近3月: "SYL_3Y",
  近6月: "SYL_6Y",
  今年来: "SYL_JN",
  近1年: "SYL_1N",
  近2年: "SYL_2N",
  近3年: "SYL_3N",
  近5年: "SYL_5N",
  成立以来: "SYL_LN",
};
const WrapperTable = styled.table`
  th,
  td {
    width: 20%;
    text-align: center;
    font-size: 14px;
  }
  th {
    color: #999;
    font-weight: 500;
  }
`;
class FundOrder extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      fundlist: [],
      defaultValue: "SYL_JN",
    };
  }
  render() {
    console.log(this.state.fundlist);
    console.log("render");
    const { fundlist } = this.state;
    return (
      <div className="bg-blue-400">
        <div className="h-[20vh] w-[100vw] flex flex-col justify-around p-[10px]">
          <div className="flex justify-between items-center text-[18px] text-white">
            <Icon icon="ion:chevron-back-sharp" />
            <p>基金排行榜</p>
            <Icon icon="clarity:search-line" />
          </div>
          <div className="text-white flex justify-between">
            <p className="flex items-center">
              基金类型{" "}
              <Icon
                icon="material-symbols-light:arrow-drop-down-rounded"
                className="text-[20px]"
              />
            </p>
            <p className="flex items-center bg-[rgba(0, 0, 0)] rounded-[15px]">
              <Icon icon="jam:book" className="text-[20px]" />
              使用指南
            </p>
          </div>
        </div>
        <div className="bg-white rounded-t-[20px] p-[10px] overflow-hidden">
          <div></div>
          <WrapperTable className="text-center text-[#000]">
            <thead>
              <tr>
                <th className="text-left">基金名称</th>
                <th>涨跌幅</th>
                <th>夏普比率</th>
                <th>最大回撤</th>
              </tr>
            </thead>
            <tbody>
              {fundlist.map((item) => (
                <tr key={item.FCODE}>
                  <td>
                    <p className="text-left line-clamp-2 font-[500]">
                      {item.SHORTNAME}
                    </p>
                    <p className="text-gray-300">{item.FCODE}</p>
                  </td>
                  <td className="text-red-600">{item.SYL_1N}</td>
                  <td>{item.SYL_JN}</td>
                  <td>{item.SYL_Z}</td>
                </tr>
              ))}
            </tbody>
          </WrapperTable>
        </div>
        <div className="bg-white">
          <CapsuleTabs
            defaultActiveKey={this.state.defaultValue}
            onChange={(e) => {
              this.setState({ defaultValue: e });
            }}
          >
            {Object.entries(arr).map(([key, value]) => {
              return <CapsuleTabs.Tab title={key} key={value} />;
            })}
          </CapsuleTabs>
        </div>
      </div>
    );
  }
  getfund() {
    getFundThemeList({ SortColumn: this.state.defaultValue })
      .then((val) => {
        this.setState({
          fundlist: val.data.Datas,
        });
        // console.log(val);
      })
      .catch((err) => {
        console.log(err);
      });
  }

  componentDidMount() {
    this.getfund();
  }

  shouldComponentUpdate(_, value) {
    console.log(this.state.fundlist);
    // console.log(a,value);
    // console.log(value);
    // return false
    if (this.state.fundlist.length === 0 && value.fundlist.length > 0) {
      return true;
    }
    return this.state.defaultValue !== value.defaultValue;
  }

  componentDidUpdate() {
    this.getfund();
    // console.log("a");
    console.log(this.state.fundlist);
  }
}

export default FundOrder;
